// Layout.js
import React from 'react';
import Header from '../partials/Header';
import Footer from '../partials/Footer';
import {
  MDBNavbar,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBNavbarToggler,
  MDBContainer,
  MDBIcon,
  MDBBtn,
  MDBCollapse
} from 'mdb-react-ui-kit';

const Layout = ({ children }) => {
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <MDBIcon fas icon="crow fa-3x me-3" style={{ color: '#709085' }}/>
        <a className="navbar-brand" href="#">4Paws</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item active">
              <a className="nav-link" href="#">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Lost Animals</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Found Animals</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">My Account</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Logout</a>
            </li>
          </ul>
        </div>
      </nav>
      <div style={{ marginTop: '64px' }}> {/* Add margin top to make space for the header */}
        {children} {/* Content of the page */}
      </div>
      <Footer className="mb-0" /> {/* Footer component */}
    </div>
  );
};

export default Layout;
